import React from "react";

class Nine extends React.Component{
        constructor(){
            super()
            this.state = {
                Name : "MUHAMMAD SOHAIL",
                Occupation : "Software Developer",
            }
        }
            changeState(){
                this.setState({
                    Name : "MEMON",
                    Age : 63,
                })
            }
    render(){
        return(
            <div>
                <h1>{this.state.Name} {this.state.Occupation}</h1>
            </div>
        )
    }
}

export default Nine;
